 * App组件 - 应用入口点
 * 使用AuthProvider包装整个应用，提供认证上下文
 * 使用AppRoutes组件处理路由配置
 */
const App: React.FC = () => {
  return (
    <AuthProvider>
      <AppRoutes />
    </AuthProvider>
  );
};

export default App;
